import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import Modal from 'react-modal';
import './styles/styles.css';

Modal.setAppElement('#root');

const EmployeesList = () => {
    const [employees, setEmployees] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);
    const navigate = useNavigate();
    const [modalIsOpen, setModalIsOpen] = useState(false);
    const [selectedEmployee, setSelectedEmployee] = useState(null);
    const [confirmationDialogOpen, setConfirmationDialogOpen] = useState(false);

    useEffect(() => {
        // ... (reszta kodu useEffect)
    }, [navigate]);

    const openModal = (employee) => {
        setSelectedEmployee(employee);
        setModalIsOpen(true);
    };

    const closeModal = () => {
        setSelectedEmployee(null);
        setModalIsOpen(false);
    };

    const handleEditEmployee = (employee) => {
        openModal(employee);
    };

    const handleDeleteEmployee = (employee) => {
        setSelectedEmployee(employee);
        setConfirmationDialogOpen(true);
    };

    const handleConfirmDelete = async () => {
        // ... (reszta kodu handleConfirmDelete)
    };

    const handleSaveEmployee = async () => {
        // ... (reszta kodu handleSaveEmployee)
    };

    const ConfirmationDialog = ({ onConfirm, onCancel }) => {
        return (
            <div className="dialog">
                <h2>Czy na pewno chcesz usunąć tego pracownika?</h2>
                <div className="button-group">
                    <button onClick={onConfirm} className="btn-delete">Tak</button>
                    <button onClick={onCancel} className="btn-cancel">Nie</button>
                </div>
            </div>
        );
    };

    if (loading) {
        // ... (reszta kodu loading)
    }

    if (error) {
        // ... (reszta kodu error)
    }

    return (
        <div className="p-6">
            <div className="flex items-center mb-6">
                <h3 className="text-2xl font-semibold text-gray-800">Lista pracowników</h3>
            </div>

            {/* ... (reszta kodu tabeli pracowników) */}

            <Modal
                isOpen={modalIsOpen}
                onRequestClose={closeModal}
                className="custom-modal" // Dodaj klasę CSS
                contentLabel="Edycja pracownika"
            >
                {selectedEmployee && (
                    <div className="dialog">
                        <h2>Edycja pracownika</h2>
                        <input
                            type="text"
                            value={selectedEmployee.first_name}
                            onChange={(e) => setSelectedEmployee({ ...selectedEmployee, first_name: e.target.value })}
                            placeholder="Imię"
                        />
                        <input
                            type="text"
                            value={selectedEmployee.last_name}
                            onChange={(e) => setSelectedEmployee({ ...selectedEmployee, last_name: e.target.value })}
                            placeholder="Nazwisko"
                        />
                        <input
                            type="text"
                            value={selectedEmployee.specialization}
                            onChange={(e) => setSelectedEmployee({ ...selectedEmployee, specialization: e.target.value })}
                            placeholder="Specjalizacja"
                        />
                        <input
                            type="email"
                            value={selectedEmployee.email}
                            onChange={(e) => setSelectedEmployee({ ...selectedEmployee, email: e.target.value })}
                            placeholder="Email"
                        />
                        <input
                            type="tel"
                            value={selectedEmployee.phone}
                            onChange={(e) => setSelectedEmployee({ ...selectedEmployee, phone: e.target.value })}
                            placeholder="Telefon"
                        />
                        <div className="button-group">
                            <button onClick={handleSaveEmployee} className="btn-save">Zapisz</button>
                            <button onClick={closeModal} className="btn-cancel">Anuluj</button>
                        </div>
                    </div>
                )}
            </Modal>

            {confirmationDialogOpen && (
                <ConfirmationDialog
                    onConfirm={handleConfirmDelete}
                    onCancel={() => setConfirmationDialogOpen(false)}
                />
            )}
        </div>
    );
};

export default EmployeesList;
